import React, { Component } from "react";
import { Button } from "react-onsenui";

class Form extends Component {
  render() {
    return (
      <>
        <h1>Hello World</h1>
        <section style={{ margin: "16px", textAlign: "center" }}>
          <Button onClick={this.pushPage.bind(this, navigator)}>Submit</Button>
        </section>
      </>
    );
  }
}

export default Form;
